import React from "react";
import pokemons from "./data";

const {id, name, type, averageWeight, image, moreInfo} = this.pro
class Pokemon extends React.Component {
  render() {
    return (
      pokemons.map((poke) => {
        return poke.name;      
      })
    )
  }
}

export default Pokemon;
